// SPDX-License-Identifier: MIT
pragma solidity ^0.8.24;

import "@openzeppelin/contracts/token/ERC20/ERC20.sol";
import "@openzeppelin/contracts/access/Ownable.sol";
import "@openzeppelin/contracts/security/ReentrancyGuard.sol";

contract TGToken is ERC20 {
    address public creator;
    uint256 public socialScore;
    uint256 public lastUpdate;

    constructor(
        string memory name,
        string memory symbol,
        address _creator
    ) ERC20(name, symbol) {
        creator = _creator;
        lastUpdate = block.timestamp;
    }

    function updateSocialScore(uint256 newScore) external {
        require(msg.sender == creator, "Only creator can update score");
        socialScore = newScore;
        lastUpdate = block.timestamp;
    }
}

contract TGTokenFactory is Ownable, ReentrancyGuard {
    uint256 public constant MINT_FEE = 0.01 ether;
    uint256 public constant CREATOR_FEE = 200; // 2% (200 basis points)
    uint256 public constant PLATFORM_FEE = 200; // 2% (200 basis points)

    mapping(string => address) public telegramToToken;
    mapping(address => string) public tokenToTelegram;

    event TokenCreated(
        string indexed telegramUsername,
        address indexed tokenAddress,
        address indexed creator
    );

    constructor() Ownable() {}

    function createToken(
        string memory telegramUsername
    ) external payable nonReentrant {
        require(msg.value >= MINT_FEE, "Insufficient mint fee");
        require(
            telegramToToken[telegramUsername] == address(0),
            "Username already taken"
        );

        string memory symbol = string(
            abi.encodePacked("TG_", telegramUsername)
        );
        TGToken newToken = new TGToken(telegramUsername, symbol, msg.sender);

        telegramToToken[telegramUsername] = address(newToken);
        tokenToTelegram[address(newToken)] = telegramUsername;

        emit TokenCreated(telegramUsername, address(newToken), msg.sender);
    }

    function getTokenAddress(
        string memory telegramUsername
    ) external view returns (address) {
        return telegramToToken[telegramUsername];
    }

    function getTelegramUsername(
        address tokenAddress
    ) external view returns (string memory) {
        return tokenToTelegram[tokenAddress];
    }

    function withdrawFees() external onlyOwner {
        uint256 balance = address(this).balance;
        require(balance > 0, "No fees to withdraw");

        (bool success, ) = owner().call{value: balance}("");
        require(success, "Withdrawal failed");
    }
}

